import React from "react";

function FormFloating(props) {
  return (
    <div class={`relative ${props.class}`} >
      <input
        type={`${props.type}`}
        id={`${props.name}`}
        name
        class="block px-2.5 pb-2.5 pt-4 w-full text-sm text-gray-900 bg-transparent rounded-lg border border-gray-300 appearance-none focus:outline-none focus:ring-0 focus:border-blue-600 peer"
        placeholder=" "
      />

      <label
        for="floating_outlined"
        class="absolute text-sm text-gray-500 duration-300 transform -translate-y-4 scale-75 top-2 z-10 origin-[0] bg-white px-2 
              peer-focus:px-2 peer-focus:text-blue-600 
              peer-placeholder-shown:scale-100 peer-placeholder-shown:-translate-y-1/2 peer-placeholder-shown:top-1/2 
              peer-focus:top-2 peer-focus:scale-75 peer-focus:-translate-y-4 
              rtl:peer-focus:translate-x-1/4 rtl:peer-focus:left-auto start-1"
      >
        <i className={`${props.icon}`}></i>&nbsp;{props.text}
      </label>
      {<span className="fixed top-1/2 right-0"><i className="bi bi-eye"></i></span>}
    </div>
  );
}
function Button(props){
  return(
    <button className={`bg-${props.color} w-full p-2 text-${props.textColor} font-semibold rounded-2xl`} type={`${props.type}`}>{props.text}</button>
  )
}
export {FormFloating, Button};
